import React from 'react';
import schedule from '../../data/Schedule.json';

export const WeeklySchedule = () => {
    return (
        <div>
            <h2>Графік тижня користувача</h2>
            <table>
                <thead>
                    <tr>
                        <th>День</th>
                        {schedule.map((user) => (
                        <th key={user.day}>{user.day}</th>
                    ))}
                    </tr>
                </thead>
                <tbody>
                    {schedule.map((user) => (
                        <tr key={user.id}>
                            <td>{user.day}</td>
                            {Object.keys(user.plan).map((time) => (
                                <td key={time}>{user.plan[time]}</td>
                            ))}
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}
